CREATE DEFINER=`root`@`localhost` FUNCTION `Volumen`(valor1 INT) RETURNS varchar(10) CHARSET latin1
    DETERMINISTIC
BEGIN
    DECLARE resultado VARCHAR(10);
    IF valor1 <= 2 THEN
        SET resultado = 'CHICO';
    ELSEIF valor1 <= 4 THEN
        SET resultado = 'MEDIANO';
    ELSE
        SET resultado = 'GRANDE';
    END IF;
    RETURN resultado;
END ;;
